let name = "Raj";
function App() {
  return (
    <>
    <nav>
      <li>Home</li>
      <li>About</li>
      <li>Contact</li>
    </nav>
    <div className="blank"><h1>lovely</h1></div>
    <div className="container">
      <h1>Hello{name}</h1>
      <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Animi, obcaecati beatae. Dicta ipsam saepe repellat odit! Maxime dignissimos voluptas sed ratione autem vitae! Esse, deleniti. Quaerat veniam inventore sunt repellat commodi libero amet sed!</p>
    </div>
    </>
